//return cube([40, 50, 60]);

var b1= floor(
	translate([30,0,0],
		cylinder({d:10, h:20, fn:50})
	)
);

var b2= floor(
	translate([0,0,0],
		cube([10,10,10])
	)
);

return rotate([0,.4,0],{
		b1:{
			data:b1,
			show:true
		},
		b2:{
			data:b2,
			show:true
		}
	});


return floor(
	translate([30,0,0],
		union(

			translate([5,5,0],
				color(0xffff0000, cube([10,10,10]))
			),
			translate([0,0,0],
				cube([10,10,10])
			)
		)
	)
);

